        address to;
        uint16 lzDstChainId;
        ITOFTOperations.ILendParams lendParams;
        ITOFTOperations.IUSDOSendOptions options;
        ITOFTOperations.IUSDOApproval[] approvals;
    }

    struct TOFTSendToYBData {
        address from;
        address to;
        uint256 amount;
        uint256 assetId;
        uint16 lzDstChainId;
        ITOFTOperations.ITOFTSendOptions options;
    }
    struct USDOSendToYBData {
        address from;
        address to;
        uint256 amount;
        uint256 assetId;
        uint16 lzDstChainId;
        ITOFTOperations.IUSDOSendOptions options;
    }

    // YieldBox
    struct YieldBoxDepositData {
        uint256 assetId;
        address from;
        address to;
        uint256 amount;
        uint256 share;
    }

    // Singularity
    struct SGLAddCollateralData {
        address from;
        address to;
